import React from "react";
import '../asset/CSS/Main.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Box from "../components/Home/Box";

export default function Router_App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Box />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <div><Box/></div>;
}

function About() {
  return <h2>Đây là trang About</h2>;
}

function Users() {
  return <h2>Đây là trang About</h2>;
}
